    "amending-america-proposed-amendments-to-the-united-states-constitution-1787-to-2014",nt"isopen":
    true,nt"url": null,nt"notes": "This dataset provides information about
    more than 11,000 proposed Constitutional amendments introduced in the United States
    Congress from 1787 to 2014. This dataset is a compilation of information from several
    Congressional publications as well as a search for Constitutional amendments on
    the Congress.gov website.rnrnData available for each proposed amendment varies by
    source publication. Each entry may include a source of information, title or description
    of amendment, date of introduction, Congress, Congressional session, joint resolution
    number, sponsor name, sponsor state or territory, and the committee of referral.rnrnThe
    National Archives and Records Administration created this dataset as part of the
    Amending America initiative. To prepare for the 2016 "Amending America" exhibition
    at the National Archives Museum in Washington, D.C., NARA volunteers and staff transcribed
    and edited over 11,000 entries representing proposed amendments to the U.S. Constitution,
    as recorded by Congress.",nt"license_title": "Creative Commons CCZero",nt"extras":
